INSERT INTO `config_info` VALUES (902, 'application-dev.yml', 'dev', 'spring: \n   redis:\n    host: 127.0.0.1\n    port: 6379\n    password: \n    lettuce:\n      pool:\n        max-active: 1500\n        max-wait: 5000\n        max-idle: 500\n        min-idle: 100\n        shutdown-timeout: 1000\n   data:\n    mongodb:\n      host: 127.0.0.1\n      port: 27017\n      database: yc-framework\n      username: yc-framework\n      password: yc-framework      \nfiles:\n  access_url: http://computer.youcongtech.com\n#请求处理的超时时间\nribbon:\n  ReadTimeout: 60000\n  ConnectTimeout: 30000\n\n# feign 配置\nfeign:\n  sentinel:\n    enabled: true\n  okhttp:\n    enabled: true\n  httpclient:\n    enabled: false\n  client:\n    config:\n      default:\n        connectTimeout: 100000\n        readTimeout: 100000\n  compression:\n    request:\n      enabled: false\n    response:\n      enabled: false\n# 打开客户端的监控\nmanagement:\n  endpoints:\n    sensitive: false\n    web:\n      exposure:\n        include: \'*\'', 'aa572c906949259c908573a342a35839', '2022-09-20 09:45:08', '2022-09-21 14:20:20', 'nacos', '172.24.0.1', '', 'dev', '', '', '', 'yaml', '');
INSERT INTO `config_info` VALUES (903, 'heshuang-auth-dev.yml', 'dev', 'spring:\n  zipkin:\n    base-url: http://127.0.0.1:9411\n  sleuth:\n    sampler:\n      probability: 1\n# 配置数据源\n  datasource:\n    driver-class-name: com.mysql.jdbc.Driver\n    url: jdbc:mysql://127.0.0.1:33306/heshuang-framework?useUnicode=true&characterEncoding=UTF-8&serverTimezone=Asia/Shanghai\n    username: root\n    password: root\n# mybatis-plus相关配置\nmybatis-plus:\n  # xml扫描，多个目录用逗号或者分号分隔（告诉 Mapper 所对应的 XML 文件位置）\n  mapper-locations: classpath:mapper/*.xml\n  configuration:\n    # 是否开启自动驼峰命名规则映射:从数据库列名到Java属性驼峰命名的类似映射\n    map-underscore-to-camel-case: true\n    # 如果查询结果中包含空值的列，则 MyBatis 在映射的时候，不会映射这个字段\n    call-setters-on-nulls: true\n    # 这个配置会将执行的sql打印出来，在开发或测试的时候可以用\n    log-impl: org.apache.ibatis.logging.stdout.StdOutImpl\n# Sa-Token配置\nsa-token: \n    # token名称 (同时也是cookie名称)\n    token-name: satoken\n    # token有效期，单位s 默认30天, -1代表永不过期 \n    timeout: 2592000\n    # token临时有效期 (指定时间内无操作就视为token过期) 单位: 秒\n    activity-timeout: -1\n    # 是否允许同一账号并发登录 (为true时允许一起登录, 为false时新登录挤掉旧登录) \n    is-concurrent: true\n    # 在多人登录同一账号时，是否共用一个token (为true时所有登录共用一个token, 为false时每次登录新建一个token) \n    is-share: false\n    # token风格\n    token-style: uuid\n    # 是否输出操作日志 \n    is-log: false\nseata:\n  enabled: true\n  application-id: my_test_tx_group\n  txServiceGroup: my_test_tx_group\n  # 是否开启数据源自动代理 如果不开启设置为false\n  enable-auto-data-source-proxy: true\n  registry:\n    type: nacos\n    nacos:\n      application: seata-server\n      server-addr: 127.0.0.1:8848\n      group: ${spring.profiles.active}\n      namespace: ${spring.profiles.active}\n  config:\n    type: nacos\n    nacos:\n      serverAddr: 127.0.0.1:8848\n      group: ${spring.profiles.active}\n      namespace: ${spring.profiles.active}     \n', '7683e56670e3979917dd204f71498dea', '2022-09-20 09:45:08', '2022-09-21 11:41:10', 'nacos', '172.24.0.1', '', 'dev', '', '', '', 'yaml', '');
INSERT INTO `config_info` VALUES (904, 'heshuang-gateway-dev.yml', 'dev', 'spring:\n  cloud:\n    gateway:\n      discovery:\n        locator:\n          lowerCaseServiceId: true\n          enabled: true\n      routes:\n        ## auth\n        - id: heshuang-auth\n          uri: lb://heshuang-auth\n          predicates:\n            - Path=/cert/**\n          filters:\n            - SwaggerHeaderFilter\n            - StripPrefix=1\n        ## admin\n        - id: heshuang-admin\n          uri: lb://heshuang-admin\n          predicates:\n            - Path=/admin/**\n          filters:\n            - SwaggerHeaderFilter\n            - StripPrefix=1\n        ## cms\n        - id: heshuang-cms\n          uri: lb://heshuang-cms\n          predicates:\n            - Path=/cms/**\n          filters:\n            - SwaggerHeaderFilter\n            - StripPrefix=1\n        ## file\n        - id: heshuang-file\n          uri: lb://heshuang-file\n          predicates:\n            - Path=/file/**\n          filters:\n            - SwaggerHeaderFilter\n            - StripPrefix=1\n# 打开客户端的监控\nmanagement:\n  endpoints:\n    sensitive: false\n    web:\n      exposure:\n        include: \'*\'\n\n', '28967eb643f4ce58e7ed46962f62d345', '2022-09-20 09:45:08', '2022-09-20 09:45:08', NULL, '172.23.0.1', '', 'dev', '', NULL, NULL, 'yaml', NULL);
INSERT INTO `config_info` VALUES (908, 'heshuang-admin-dev.yml', 'dev', 'spring:\n# 配置数据源\n  datasource:\n    driver-class-name: com.mysql.jdbc.Driver\n    url: jdbc:mysql://127.0.0.1:33306/heshuang-framework?useUnicode=true&characterEncoding=UTF-8&serverTimezone=Asia/Shanghai\n    username: root\n    password: root\n# mybatis-plus相关配置\nmybatis-plus:\n  # xml扫描，多个目录用逗号或者分号分隔（告诉 Mapper 所对应的 XML 文件位置）\n  mapper-locations: classpath:mapper/*.xml\nseata:\n  enabled: true\n  application-id: my_test_tx_group\n  txServiceGroup: my_test_tx_group\n  # 是否开启数据源自动代理 如果不开启设置为false\n  enable-auto-data-source-proxy: true\n  registry:\n    type: nacos\n    nacos:\n      application: seata-server\n      server-addr: 127.0.0.1:8848\n      group: ${spring.profiles.active}\n      namespace: ${spring.profiles.active}\n  config:\n    type: nacos\n    nacos:\n      serverAddr: 127.0.0.1:8848\n      group: ${spring.profiles.active}\n      namespace: ${spring.profiles.active}   \nxxl:\n  job:\n    accessToken: heshuang\n    admin:\n      addresses: http://127.0.0.1:28888/xxl-job-admin\n    executor:\n      address: \'\'\n      appname: ${spring.application.name}\n      ip: \n      logpath: /data/applogs/xxl-job/jobhandler\n      logretentiondays: 30\n      ### 执行器端口号 [选填]：小于等于0则自动获取；默认端口为9999，单机部署多个执行器时，注意要配置不同执行器端口；\n      port: 9999   ', 'e893a958069efb9a57bf456b461f996e', '2022-09-20 11:04:23', '2022-09-22 10:02:24', 'nacos', '172.24.0.1', '', 'dev', '', '', '', 'yaml', '');
