ix.command.default.execution.isolation.thread.timeoutInMilliseconds: 30000\r\n\r\n\r\n\r\n        ', '80af222aec851c5160f039f94c81055f', '2022-08-26 02:20:43', '2022-08-26 10:20:43', 'nacos', '172.20.0.1', 'U', '');
INSERT INTO `his_config_info` VALUES (873, 930, 'sp-gateway.yml', 'DEFAULT_GROUP', '', 'spring:\r\n    cloud:\r\n        gateway:\r\n          discovery:\r\n            locator:\r\n              #开启根据微服务名称自动转发\r\n              enabled: true\r\n              #微服务名称以小写形式呈现 \r\n              lower-case-service-id: true\r\n            ', '38e6bc3a499790cf09bfdc9534e80c1d', '2022-08-26 02:47:27', '2022-08-26 10:47:28', 'nacos', '172.20.0.1', 'U', '');
INSERT INTO `his_config_info` VALUES (873, 931, 'sp-gateway.yml', 'DEFAULT_GROUP', '', 'spring:\n    cloud:\n        gateway:\n          discovery:\n            locator:\n              #开启根据微服务名称自动转发\n              enabled: true\n              #微服务名称以小写形式呈现 \n              lower-case-service-id: true\n            # 配置转发路由表 \n            routes:\n                # 后台管理\n                - id: sp-admin\n                  uri: lb://sp-admin\n                  predicates:\n                    - Path=/sp-admin/**\n                  filters:\n                    - StripPrefix=1\n                # 前台接口\n                - id: sp-home\n                  uri: lb://sp-home\n                  predicates:\n                    - Path=/sp-home/**\n                  filters:\n                    - StripPrefix=1\n            ', '5ce1fc98884f8ad3a06f02cc9791ea97', '2022-08-26 02:54:37', '2022-08-26 10:54:38', 'nacos', '172.20.0.1', 'U', '');
INSERT INTO `his_config_info` VALUES (872, 932, 'application-common-dev.yml', 'DEFAULT_GROUP', '', '# 端口\r\n#server:\r\n#    port: 8099\r\n\r\nspring: \r\n    # 数据源配置\r\n    datasource: \r\n        type: com.alibaba.druid.pool.DruidDataSource\r\n        url: jdbc:mysql://127.0.0.1:3306/sp-dev?useUnicode=true&characterEncoding=utf-8&useSSL=true&serverTimezone=UTC\r\n        username: root\r\n        password: root123456 \r\n        # 是否打开sql监控台  (生产环境请务必关闭此选项) \r\n        druid: \r\n            stat-view-servlet:\r\n                enabled: true\r\n            web-stat-filter: \r\n                enabled: true\r\n            filter:\r\n                config:\r\n                    enabled: true\r\n\r\n    # redis配置 \r\n    redis:\r\n        # Redis数据库索引（默认为0）\r\n        database: 1\r\n        # Redis服务器地址\r\n        host: 127.0.0.1\r\n        # Redis服务器连接端口\r\n        port: 6379\r\n        # Redis服务器连接密码（默认为空）\r\n        # password: \r\n        # 连接超时时间（毫秒）\r\n        timeout: 1000ms\r\n        lettuce:\r\n            pool:\r\n                # 连接池最大连接数\r\n                max-active: 200\r\n                # 连接池最大阻塞等待时间（使用负值表示没有限制）\r\n                max-wait: -1ms\r\n                # 连接池中的最大空闲连接\r\n                max-idle: 10\r\n                # 连接池中的最小空闲连接\r\n                min-idle: 0\r\n        \r\n    # 项目自定义配置 \r\n    myconfig: \r\n        # 本项目部署到的服务器域名（文件上传等等模块  要用到）\r\n        domain: http://127.0.0.1:8099\r\n    ', 'd5af13fe98532795c3ef92a6b7062cf9', '2022-08-26 02:57:18', '2022-08-26 10:57:18', 'nacos', '172.20.0.1', 'U', '');
