INSERT INTO `his_config_info` VALUES (872, 942, 'application-common-dev.yml', 'DEFAULT_GROUP', '', '# 端口\n#server:\n#    port: 8099\n\nspring: \n    # 数据源配置\n    datasource: \n        type: com.alibaba.druid.pool.DruidDataSource\n        url: jdbc:mysql://localhost:33306/sp-dev?useSSL=false&serverTimezone=GMT%2b8&characterEncoding=utf8&allowPublicKeyRetrieval=true\n        username: root\n        password: root \n        # 是否打开sql监控台  (生产环境请务必关闭此选项) \n        druid: \n            stat-view-servlet:\n                enabled: true\n            web-stat-filter: \n                enabled: true\n            filter:\n                config:\n                    enabled: true\n\n    # redis配置 \n    redis:\n        # Redis数据库索引（默认为0）\n        database: 1\n        # Redis服务器地址\n        host: 127.0.0.1\n        # Redis服务器连接端口\n        port: 6379\n        # Redis服务器连接密码（默认为空）\n        # password: \n        # 连接超时时间（毫秒）\n        timeout: 1000ms\n        lettuce:\n            pool:\n                # 连接池最大连接数\n                max-active: 200\n                # 连接池最大阻塞等待时间（使用负值表示没有限制）\n                max-wait: -1ms\n                # 连接池中的最大空闲连接\n                max-idle: 10\n                # 连接池中的最小空闲连接\n                min-idle: 0\n        \n    # 项目自定义配置 \n    myconfig: \n        # 本项目部署到的服务器域名（文件上传等等模块  要用到）\n        domain: http://127.0.0.1:8099\n    ', '457f59d804e0c35b6073b09a25493184', '2022-09-13 07:29:41', '2022-09-13 15:29:41', NULL, '172.23.0.1', 'D', '');
INSERT INTO `his_config_info` VALUES (871, 943, 'application-common.yml', 'DEFAULT_GROUP', '', 'spring: \n    # profiles: \n        # 启动环境加载，同时加载两个的写法：common,prod  优先级左>右\n        # active: core-dev\n        # active: test\n        # active: prod\n        \n# ================ 公共配置(优先级低于application-xxx.yml)  ================ \n    # mvc设置\n    mvc: \n        format: \n            # 日期映射格式\n            date: yyyy-MM-dd HH:mm:ss\n    # servlet配置 \n    servlet: \n        # 单文件大小限制1024M，避免文件上传时因为文件过大而被限制 \n        multipart: \n            max-file-size: 1024MB\n            max-request-size: 1024MB\n            \n    # 静态文件路径映射 \n    resources: \n        static-locations: classpath:/META-INF/resources/,classpath:/resources/, classpath:/static/, classpath:/public/, file:${spring.upload-config.root-folder}\n        \n    # jackson设置 \n    jackson:\n        # 默认的日期转换格式  \n        date-format: yyyy-MM-dd HH:mm:ss\n        # 解决因为时区问题，date少8小时的bug \n        # time-zone: GMT+8\n        \n    # 文件上传相关配置\n    upload-config: \n        # 文件保存的根目录，所有文件都保存在这个目录下  \n        root-folder: C:/upload-file\n        # http路由前缀，用于向前台暴露文件url  \n        http-prefix: /upload\n        \n    # 项目自定义配置 \n    myconfig: \n        # md5的盐\n        md5_salt: whatclickme\n        # 是否明文存储密码 \n        is_pw: true\n        # 是否彩色SQl日志\n        color-sql: true\n\n# Sa-Token配置\nsa-token: \n    # 关闭Cookie模式\n    is-read-cookie: false    \n\n# mybatis-plus配置  \nmybatis-plus: \n    # 配置别名包，在mapper.xml中可以直接返回SoMap\n    type-aliases-package: com.pj.utils.so\n    # 一些配置\n    configuration: \n        # 控制打印sql \n        # log-impl: org.apache.ibatis.logging.stdout.StdOutImpl\n        # 是否开启下划线转驼峰 \n        map-underscore-to-camel-case: false\n        # 即使属性为null, 也要映射 \n        call-setters-on-nulls: true\n      \n# 是否开启服务降级 \nfeign.hystrix.enabled: true\n# 服务单次调用超时秒数，超时后触发降级\nhystrix.command.default.execution.isolation.thread.timeoutInMilliseconds: 30000\n\n\n\n        ', '581839e9be325914a1c9e06f2fbcf529', '2022-09-13 07:29:44', '2022-09-13 15:29:44', NULL, '172.23.0.1', 'D', '');
INSERT INTO `his_config_info` VALUES (0, 944, 'yc-gateway-dev.yml', 'DEFAULT_GROUP', '', 'spring:\r\n  cloud:\r\n    gateway:\r\n      discovery:\r\n        locator:\r\n          lowerCaseServiceId: true\r\n          enabled: true\r\n      routes:\r\n        ## auth\r\n        - id: yc-auth\r\n          uri: lb://yc-auth\r\n          predicates:\r\n            - Path=/cert/**\r\n          filters:\r\n            - SwaggerHeaderFilter\r\n            - StripPrefix=1\r\n        ## admin\r\n        - id: yc-admin\r\n          uri: lb://yc-admin\r\n          predicates:\r\n            - Path=/admin/**\r\n          filters:\r\n            - SwaggerHeaderFilter\r\n            - StripPrefix=1\r\n        ## cms\r\n        - id: yc-cms\r\n          uri: lb://yc-cms\r\n          predicates:\r\n            - Path=/cms/**\r\n          filters:\r\n            - SwaggerHeaderFilter\r\n            - StripPrefix=1\r\n        ## file\r\n        - id: yc-file\r\n          uri: lb://yc-file\r\n          predicates:\r\n            - Path=/file/**\r\n          filters:\r\n            - SwaggerHeaderFilter\r\n            - StripPrefix=1\r\n# 打开客户端的监控\r\nmanagement:\r\n  endpoints:\r\n    sensitive: false\r\n    web:\r\n      exposure:\r\n        include: \'*\'\r\n\r\n', '4ff7b86ce680c5b0992b6ae7efe2c8e5', '2022-09-13 07:30:10', '2022-09-13 15:30:11', NULL, '172.23.0.1', 'I', '');
INSERT INTO `his_config_info` VALUES (0, 945, 'yc-auth-dev.yml', 'DEFAULT_GROUP', '', 'spring:\r\n  zipkin:\r\n    base-url: http://127.0.0.1:9411\r\n  sleuth:\r\n    sampler:\r\n      probability: 1\r\n# 配置数据源\r\n  datasource:\r\n    driver-class-name: com.mysql.jdbc.Driver\r\n    url: jdbc:mysql://127.0.0.1:3306/yc-framework?useUnicode=true&characterEncoding=UTF-8&serverTimezone=Asia/Shanghai\r\n    username: xxxx\r\n    password: xxxx\r\n# mybatis-plus相关配置\r\nmybatis-plus:\r\n  # xml扫描，多个目录用逗号或者分号分隔（告诉 Mapper 所对应的 XML 文件位置）\r\n  mapper-locations: classpath:mapper/*.xml\r\n  configuration:\r\n    # 是否开启自动驼峰命名规则映射:从数据库列名到Java属性驼峰命名的类似映射\r\n    map-underscore-to-camel-case: true\r\n    # 如果查询结果中包含空值的列，则 MyBatis 在映射的时候，不会映射这个字段\r\n    call-setters-on-nulls: true\r\n    # 这个配置会将执行的sql打印出来，在开发或测试的时候可以用\r\n    log-impl: org.apache.ibatis.logging.stdout.StdOutImpl\r\n# Sa-Token配置\r\nsa-token: \r\n    # token名称 (同时也是cookie名称)\r\n    token-name: satoken\r\n    # token有效期，单位s 默认30天, -1代表永不过期 \r\n    timeout: 2592000\r\n    # token临时有效期 (指定时间内无操作就视为token过期) 单位: 秒\r\n    activity-timeout: -1\r\n    # 是否允许同一账号并发登录 (为true时允许一起登录, 为false时新登录挤掉旧登录) \r\n    is-concurrent: true\r\n    # 在多人登录同一账号时，是否共用一个token (为true时所有登录共用一个token, 为false时每次登录新建一个token) \r\n    is-share: false\r\n    # token风格\r\n    token-style: uuid\r\n    # 是否输出操作日志 \r\n    is-log: false\r\n', 'bd5963307b2bc1fce1bf509cda42715c', '2022-09-13 07:30:34', '2022-09-13 15:30:34', NULL, '172.23.0.1', 'I', '');
INSERT INTO `his_config_info` VALUES (0, 946, 'application-dev.yml', 'DEFAULT_GROUP', '', 'spring: \r\n   redis:\r\n    host: 127.0.0.1\r\n    port: 6379\r\n    password: \r\n    lettuce:\r\n      pool:\r\n        max-active: 1500\r\n        max-wait: 5000\r\n        max-idle: 500\r\n        min-idle: 100\r\n        shutdown-timeout: 1000\r\nfiles:\r\n  access_url: http://computer.youcongtech.com\r\n#请求处理的超时时间\r\nribbon:\r\n  ReadTimeout: 10000\r\n  ConnectTimeout: 10000\r\n\r\n# feign 配置\r\nfeign:\r\n  sentinel:\r\n    enabled: true\r\n  okhttp:\r\n    enabled: true\r\n  httpclient:\r\n    enabled: false\r\n  client:\r\n    config:\r\n      default:\r\n        connectTimeout: 100000\r\n        readTimeout: 100000\r\n  compression:\r\n    request:\r\n      enabled: false\r\n    response:\r\n      enabled: false\r\n# 打开客户端的监控\r\nmanagement:\r\n  endpoints:\r\n    sensitive: false\r\n    web:\r\n      exposure:\r\n        include: \'*\'\r\n', 'eae0cbaacb7b6001ab4b05599f598154', '2022-09-13 07:30:56', '2022-09-13 15:30:56', NULL, '172.23.0.1', 'I', '');
INSERT INTO `his_config_info` VALUES (886, 947, 'yc-auth-dev.yml', 'DEFAULT_GROUP', '', 'spring:\r\n  zipkin:\r\n    base-url: http://127.0.0.1:9411\r\n  sleuth:\r\n    sampler:\r\n      probability: 1\r\n# 配置数据源\r\n  datasource:\r\n    driver-class-name: com.mysql.jdbc.Driver\r\n    url: jdbc:mysql://127.0.0.1:3306/yc-framework?useUnicode=true&characterEncoding=UTF-8&serverTimezone=Asia/Shanghai\r\n    username: xxxx\r\n    password: xxxx\r\n# mybatis-plus相关配置\r\nmybatis-plus:\r\n  # xml扫描，多个目录用逗号或者分号分隔（告诉 Mapper 所对应的 XML 文件位置）\r\n  mapper-locations: classpath:mapper/*.xml\r\n  configuration:\r\n    # 是否开启自动驼峰命名规则映射:从数据库列名到Java属性驼峰命名的类似映射\r\n    map-underscore-to-camel-case: true\r\n    # 如果查询结果中包含空值的列，则 MyBatis 在映射的时候，不会映射这个字段\r\n    call-setters-on-nulls: true\r\n    # 这个配置会将执行的sql打印出来，在开发或测试的时候可以用\r\n    log-impl: org.apache.ibatis.logging.stdout.StdOutImpl\r\n# Sa-Token配置\r\nsa-token: \r\n    # token名称 (同时也是cookie名称)\r\n    token-name: satoken\r\n    # token有效期，单位s 默认30天, -1代表永不过期 \r\n    timeout: 2592000\r\n    # token临时有效期 (指定时间内无操作就视为token过期) 单位: 秒\r\n    activity-timeout: -1\r\n    # 是否允许同一账号并发登录 (为true时允许一起登录, 为false时新登录挤掉旧登录) \r\n    is-concurrent: true\r\n    # 在多人登录同一账号时，是否共用一个token (为true时所有登录共用一个token, 为false时每次登录新建一个token) \r\n    is-share: false\r\n    # token风格\r\n    token-style: uuid\r\n    # 是否输出操作日志 \r\n    is-log: false\r\n', 'bd5963307b2bc1fce1bf509cda42715c', '2022-09-13 07:40:19', '2022-09-13 15:40:19', 'nacos', '172.23.0.1', 'U', '');
