INSERT INTO `his_config_info` VALUES (0, 951, 'yc-file-dev.yml', 'DEFAULT_GROUP', '', 'spring:\r\n# 配置数据源\r\n  datasource:\r\n    driver-class-name: com.mysql.jdbc.Driver\r\n    url: jdbc:mysql://127.0.0.1:33306/yc-framework?useUnicode=true&characterEncoding=UTF-8&serverTimezone=Asia/Shanghai\r\n    username: root\r\n    password: root\r\n# mybatis-plus相关配置\r\nmybatis-plus:\r\n  # xml扫描，多个目录用逗号或者分号分隔（告诉 Mapper 所对应的 XML 文件位置）\r\n  mapper-locations: classpath:mapper/*.xml\r\n  configuration:\r\n    # 是否开启自动驼峰命名规则映射:从数据库列名到Java属性驼峰命名的类似映射\r\n    map-underscore-to-camel-case: true\r\n    # 如果查询结果中包含空值的列，则 MyBatis 在映射的时候，不会映射这个字段\r\n    call-setters-on-nulls: true\r\n    # 这个配置会将执行的sql打印出来，在开发或测试的时候可以用\r\n    log-impl: org.apache.ibatis.logging.stdout.StdOutImpl', 'e6beb7223d6ae3a6257d4f9e4b7a17a8', '2022-09-13 08:21:41', '2022-09-13 16:21:42', NULL, '172.23.0.1', 'I', '');
INSERT INTO `his_config_info` VALUES (0, 952, 'yc-job-dev.yml', 'DEFAULT_GROUP', '', 'spring:\r\n  # Quartz 的配置，对应 QuartzProperties 配置类\r\n  quartz:\r\n    job-store-type: memory # Job 存储器类型。默认为 memory 表示内存，可选 jdbc 使用数据库。\r\n    auto-startup: true # Quartz 是否自动启动\r\n    startup-delay: 0 # 延迟 N 秒启动\r\n    wait-for-jobs-to-complete-on-shutdown: true # 应用关闭时，是否等待定时任务执行完成。默认为 false ，建议设置为 true\r\n    overwrite-existing-jobs: false # 是否覆盖已有 Job 的配置\r\n    properties: # 添加 Quartz Scheduler 附加属性\r\n      org:\r\n        quartz:\r\n          threadPool:\r\n            threadCount: 25 # 线程池大小。默认为 10 。\r\n            threadPriority: 5 # 线程优先级\r\n            class: org.quartz.simpl.SimpleThreadPool # 线程池类型\r\n#    jdbc: # 这里暂时不说明，使用 JDBC 的 JobStore 的时候，才需要配置\r\n', 'e016bf03e88cbfd1a340b3db8172ee47', '2022-09-13 08:22:12', '2022-09-13 16:22:12', NULL, '172.23.0.1', 'I', '');
INSERT INTO `his_config_info` VALUES (887, 953, 'application-dev.yml', 'DEFAULT_GROUP', '', 'spring: \r\n   redis:\r\n    host: 127.0.0.1\r\n    port: 6379\r\n    password: \r\n    lettuce:\r\n      pool:\r\n        max-active: 1500\r\n        max-wait: 5000\r\n        max-idle: 500\r\n        min-idle: 100\r\n        shutdown-timeout: 1000\r\nfiles:\r\n  access_url: http://computer.youcongtech.com\r\n#请求处理的超时时间\r\nribbon:\r\n  ReadTimeout: 10000\r\n  ConnectTimeout: 10000\r\n\r\n# feign 配置\r\nfeign:\r\n  sentinel:\r\n    enabled: true\r\n  okhttp:\r\n    enabled: true\r\n  httpclient:\r\n    enabled: false\r\n  client:\r\n    config:\r\n      default:\r\n        connectTimeout: 100000\r\n        readTimeout: 100000\r\n  compression:\r\n    request:\r\n      enabled: false\r\n    response:\r\n      enabled: false\r\n# 打开客户端的监控\r\nmanagement:\r\n  endpoints:\r\n    sensitive: false\r\n    web:\r\n      exposure:\r\n        include: \'*\'\r\n', 'eae0cbaacb7b6001ab4b05599f598154', '2022-09-14 07:15:54', '2022-09-14 15:15:54', 'nacos', '172.23.0.1', 'U', '');
INSERT INTO `his_config_info` VALUES (0, 954, 'heshuang-auth-dev.yml', 'DEFAULT_GROUP', '', 'spring:\n  zipkin:\n    base-url: http://127.0.0.1:9411\n  sleuth:\n    sampler:\n      probability: 1\n# 配置数据源\n  datasource:\n    driver-class-name: com.mysql.jdbc.Driver\n    url: jdbc:mysql://127.0.0.1:33306/yc-framework?useUnicode=true&characterEncoding=UTF-8&serverTimezone=Asia/Shanghai\n    username: root\n    password: root\n# mybatis-plus相关配置\nmybatis-plus:\n  # xml扫描，多个目录用逗号或者分号分隔（告诉 Mapper 所对应的 XML 文件位置）\n  mapper-locations: classpath:mapper/*.xml\n  configuration:\n    # 是否开启自动驼峰命名规则映射:从数据库列名到Java属性驼峰命名的类似映射\n    map-underscore-to-camel-case: true\n    # 如果查询结果中包含空值的列，则 MyBatis 在映射的时候，不会映射这个字段\n    call-setters-on-nulls: true\n    # 这个配置会将执行的sql打印出来，在开发或测试的时候可以用\n    log-impl: org.apache.ibatis.logging.stdout.StdOutImpl\n# Sa-Token配置\nsa-token: \n    # token名称 (同时也是cookie名称)\n    token-name: satoken\n    # token有效期，单位s 默认30天, -1代表永不过期 \n    timeout: 2592000\n    # token临时有效期 (指定时间内无操作就视为token过期) 单位: 秒\n    activity-timeout: -1\n    # 是否允许同一账号并发登录 (为true时允许一起登录, 为false时新登录挤掉旧登录) \n    is-concurrent: true\n    # 在多人登录同一账号时，是否共用一个token (为true时所有登录共用一个token, 为false时每次登录新建一个token) \n    is-share: false\n    # token风格\n    token-style: uuid\n    # 是否输出操作日志 \n    is-log: false\n', 'beebd8915173075dcda04c8f4d032cb2', '2022-09-14 08:23:47', '2022-09-14 16:23:48', NULL, '172.23.0.1', 'I', '');
