INSERT INTO `his_config_info` VALUES (885, 1224, 'yc-gateway-dev.yml', 'DEFAULT_GROUP', '', 'spring:\r\n  cloud:\r\n    gateway:\r\n      discovery:\r\n        locator:\r\n          lowerCaseServiceId: true\r\n          enabled: true\r\n      routes:\r\n        ## auth\r\n        - id: yc-auth\r\n          uri: lb://yc-auth\r\n          predicates:\r\n            - Path=/cert/**\r\n          filters:\r\n            - SwaggerHeaderFilter\r\n            - StripPrefix=1\r\n        ## admin\r\n        - id: yc-admin\r\n          uri: lb://yc-admin\r\n          predicates:\r\n            - Path=/admin/**\r\n          filters:\r\n            - SwaggerHeaderFilter\r\n            - StripPrefix=1\r\n        ## cms\r\n        - id: yc-cms\r\n          uri: lb://yc-cms\r\n          predicates:\r\n            - Path=/cms/**\r\n          filters:\r\n            - SwaggerHeaderFilter\r\n            - StripPrefix=1\r\n        ## file\r\n        - id: yc-file\r\n          uri: lb://yc-file\r\n          predicates:\r\n            - Path=/file/**\r\n          filters:\r\n            - SwaggerHeaderFilter\r\n            - StripPrefix=1\r\n# 打开客户端的监控\r\nmanagement:\r\n  endpoints:\r\n    sensitive: false\r\n    web:\r\n      exposure:\r\n        include: \'*\'\r\n\r\n', '4ff7b86ce680c5b0992b6ae7efe2c8e5', '2022-09-20 08:58:25', '2022-09-20 16:58:25', NULL, '172.24.0.1', 'D', '');
INSERT INTO `his_config_info` VALUES (886, 1225, 'yc-auth-dev.yml', 'DEFAULT_GROUP', '', 'spring:\n  zipkin:\n    base-url: http://127.0.0.1:9411\n  sleuth:\n    sampler:\n      probability: 1\n# 配置数据源\n  datasource:\n    driver-class-name: com.mysql.jdbc.Driver\n    url: jdbc:mysql://127.0.0.1:33306/yc-framework?useUnicode=true&characterEncoding=UTF-8&serverTimezone=Asia/Shanghai\n    username: root\n    password: root\n# mybatis-plus相关配置\nmybatis-plus:\n  # xml扫描，多个目录用逗号或者分号分隔（告诉 Mapper 所对应的 XML 文件位置）\n  mapper-locations: classpath:mapper/*.xml\n  configuration:\n    # 是否开启自动驼峰命名规则映射:从数据库列名到Java属性驼峰命名的类似映射\n    map-underscore-to-camel-case: true\n    # 如果查询结果中包含空值的列，则 MyBatis 在映射的时候，不会映射这个字段\n    call-setters-on-nulls: true\n    # 这个配置会将执行的sql打印出来，在开发或测试的时候可以用\n    log-impl: org.apache.ibatis.logging.stdout.StdOutImpl\n# Sa-Token配置\nsa-token: \n    # token名称 (同时也是cookie名称)\n    token-name: satoken\n    # token有效期，单位s 默认30天, -1代表永不过期 \n    timeout: 2592000\n    # token临时有效期 (指定时间内无操作就视为token过期) 单位: 秒\n    activity-timeout: -1\n    # 是否允许同一账号并发登录 (为true时允许一起登录, 为false时新登录挤掉旧登录) \n    is-concurrent: true\n    # 在多人登录同一账号时，是否共用一个token (为true时所有登录共用一个token, 为false时每次登录新建一个token) \n    is-share: false\n    # token风格\n    token-style: uuid\n    # 是否输出操作日志 \n    is-log: false\n', 'beebd8915173075dcda04c8f4d032cb2', '2022-09-20 08:58:25', '2022-09-20 16:58:25', NULL, '172.24.0.1', 'D', '');
INSERT INTO `his_config_info` VALUES (887, 1226, 'application-dev.yml', 'DEFAULT_GROUP', '', 'spring: \n   redis:\n    host: 127.0.0.1\n    port: 6379\n    password: \n    lettuce:\n      pool:\n        max-active: 1500\n        max-wait: 5000\n        max-idle: 500\n        min-idle: 100\n        shutdown-timeout: 1000\n   data:\n    mongodb:\n      host: 127.0.0.1\n      port: 27017\n      database: yc-framework\n      username: yc-framework\n      password: yc-framework      \nfiles:\n  access_url: http://computer.youcongtech.com\n#请求处理的超时时间\nribbon:\n  ReadTimeout: 10000\n  ConnectTimeout: 10000\n\n# feign 配置\nfeign:\n  sentinel:\n    enabled: true\n  okhttp:\n    enabled: true\n  httpclient:\n    enabled: false\n  client:\n    config:\n      default:\n        connectTimeout: 100000\n        readTimeout: 100000\n  compression:\n    request:\n      enabled: false\n    response:\n      enabled: false\n# 打开客户端的监控\nmanagement:\n  endpoints:\n    sensitive: false\n    web:\n      exposure:\n        include: \'*\'\n', '408e1da1ddce9c9450cea7704baade34', '2022-09-20 08:58:25', '2022-09-20 16:58:25', NULL, '172.24.0.1', 'D', '');
INSERT INTO `his_config_info` VALUES (889, 1227, 'yc-admin-dev.yml', 'DEFAULT_GROUP', '', 'spring:\r\n# 配置数据源\r\n  datasource:\r\n    driver-class-name: com.mysql.jdbc.Driver\r\n    url: jdbc:mysql://127.0.0.1:33306/yc-framework?useUnicode=true&characterEncoding=UTF-8&serverTimezone=Asia/Shanghai\r\n    username: root\r\n    password: root\r\n# mybatis-plus相关配置\r\nmybatis-plus:\r\n  # xml扫描，多个目录用逗号或者分号分隔（告诉 Mapper 所对应的 XML 文件位置）\r\n  mapper-locations: classpath:mapper/*.xml\r\n', '930c0d76fad95234c1f0cdf9b89b4702', '2022-09-20 08:58:25', '2022-09-20 16:58:25', NULL, '172.24.0.1', 'D', '');
