INSERT INTO `his_config_info` VALUES (891, 1229, 'yc-crawler-dev.yml', 'DEFAULT_GROUP', '', 'spring:\r\n# 配置数据源\r\n  datasource:\r\n    driver-class-name: com.mysql.jdbc.Driver\r\n    url: jdbc:mysql://127.0.0.1:33306/yc-framework?useUnicode=true&characterEncoding=UTF-8&serverTimezone=Asia/Shanghai\r\n    username: root\r\n    password: root\r\n# mybatis-plus相关配置\r\nmybatis-plus:\r\n  # xml扫描，多个目录用逗号或者分号分隔（告诉 Mapper 所对应的 XML 文件位置）\r\n  mapper-locations: classpath:mapper/*.xml', '3ff3ba482b290f741620dbabd3bc8f98', '2022-09-20 08:58:25', '2022-09-20 16:58:25', NULL, '172.24.0.1', 'D', '');
INSERT INTO `his_config_info` VALUES (892, 1230, 'yc-file-dev.yml', 'DEFAULT_GROUP', '', 'spring:\r\n# 配置数据源\r\n  datasource:\r\n    driver-class-name: com.mysql.jdbc.Driver\r\n    url: jdbc:mysql://127.0.0.1:33306/yc-framework?useUnicode=true&characterEncoding=UTF-8&serverTimezone=Asia/Shanghai\r\n    username: root\r\n    password: root\r\n# mybatis-plus相关配置\r\nmybatis-plus:\r\n  # xml扫描，多个目录用逗号或者分号分隔（告诉 Mapper 所对应的 XML 文件位置）\r\n  mapper-locations: classpath:mapper/*.xml\r\n  configuration:\r\n    # 是否开启自动驼峰命名规则映射:从数据库列名到Java属性驼峰命名的类似映射\r\n    map-underscore-to-camel-case: true\r\n    # 如果查询结果中包含空值的列，则 MyBatis 在映射的时候，不会映射这个字段\r\n    call-setters-on-nulls: true\r\n    # 这个配置会将执行的sql打印出来，在开发或测试的时候可以用\r\n    log-impl: org.apache.ibatis.logging.stdout.StdOutImpl', 'e6beb7223d6ae3a6257d4f9e4b7a17a8', '2022-09-20 08:58:25', '2022-09-20 16:58:25', NULL, '172.24.0.1', 'D', '');
INSERT INTO `his_config_info` VALUES (893, 1231, 'yc-job-dev.yml', 'DEFAULT_GROUP', '', 'spring:\r\n  # Quartz 的配置，对应 QuartzProperties 配置类\r\n  quartz:\r\n    job-store-type: memory # Job 存储器类型。默认为 memory 表示内存，可选 jdbc 使用数据库。\r\n    auto-startup: true # Quartz 是否自动启动\r\n    startup-delay: 0 # 延迟 N 秒启动\r\n    wait-for-jobs-to-complete-on-shutdown: true # 应用关闭时，是否等待定时任务执行完成。默认为 false ，建议设置为 true\r\n    overwrite-existing-jobs: false # 是否覆盖已有 Job 的配置\r\n    properties: # 添加 Quartz Scheduler 附加属性\r\n      org:\r\n        quartz:\r\n          threadPool:\r\n            threadCount: 25 # 线程池大小。默认为 10 。\r\n            threadPriority: 5 # 线程优先级\r\n            class: org.quartz.simpl.SimpleThreadPool # 线程池类型\r\n#    jdbc: # 这里暂时不说明，使用 JDBC 的 JobStore 的时候，才需要配置\r\n', 'e016bf03e88cbfd1a340b3db8172ee47', '2022-09-20 08:58:25', '2022-09-20 16:58:25', NULL, '172.24.0.1', 'D', '');
INSERT INTO `his_config_info` VALUES (895, 1232, 'heshuang-auth-dev.yml', 'DEFAULT_GROUP', '', 'spring:\n  zipkin:\n    base-url: http://127.0.0.1:9411\n  sleuth:\n    sampler:\n      probability: 1\n# 配置数据源\n  datasource:\n    driver-class-name: com.mysql.jdbc.Driver\n    url: jdbc:mysql://127.0.0.1:33306/heshuang-framework?useUnicode=true&characterEncoding=UTF-8&serverTimezone=Asia/Shanghai\n    username: root\n    password: root\n# mybatis-plus相关配置\nmybatis-plus:\n  # xml扫描，多个目录用逗号或者分号分隔（告诉 Mapper 所对应的 XML 文件位置）\n  mapper-locations: classpath:mapper/*.xml\n  configuration:\n    # 是否开启自动驼峰命名规则映射:从数据库列名到Java属性驼峰命名的类似映射\n    map-underscore-to-camel-case: true\n    # 如果查询结果中包含空值的列，则 MyBatis 在映射的时候，不会映射这个字段\n    call-setters-on-nulls: true\n    # 这个配置会将执行的sql打印出来，在开发或测试的时候可以用\n    log-impl: org.apache.ibatis.logging.stdout.StdOutImpl\n# Sa-Token配置\nsa-token: \n    # token名称 (同时也是cookie名称)\n    token-name: satoken\n    # token有效期，单位s 默认30天, -1代表永不过期 \n    timeout: 2592000\n    # token临时有效期 (指定时间内无操作就视为token过期) 单位: 秒\n    activity-timeout: -1\n    # 是否允许同一账号并发登录 (为true时允许一起登录, 为false时新登录挤掉旧登录) \n    is-concurrent: true\n    # 在多人登录同一账号时，是否共用一个token (为true时所有登录共用一个token, 为false时每次登录新建一个token) \n    is-share: false\n    # token风格\n    token-style: uuid\n    # 是否输出操作日志 \n    is-log: false\n', '2a61aa417508b5703aa759094b6af9bf', '2022-09-20 08:58:25', '2022-09-20 16:58:25', NULL, '172.24.0.1', 'D', '');
INSERT INTO `his_config_info` VALUES (897, 1233, 'heshuang-gateway-dev.yml', 'DEFAULT_GROUP', '', 'spring:\n  cloud:\n    gateway:\n      discovery:\n        locator:\n          lowerCaseServiceId: true\n          enabled: true\n      routes:\n        ## auth\n        - id: heshuang-auth\n          uri: lb://heshuang-auth\n          predicates:\n            - Path=/cert/**\n          filters:\n            - SwaggerHeaderFilter\n            - StripPrefix=1\n        ## admin\n        - id: heshuang-admin\n          uri: lb://heshuang-admin\n          predicates:\n            - Path=/admin/**\n          filters:\n            - SwaggerHeaderFilter\n            - StripPrefix=1\n        ## cms\n        - id: heshuang-cms\n          uri: lb://heshuang-cms\n          predicates:\n            - Path=/cms/**\n          filters:\n            - SwaggerHeaderFilter\n            - StripPrefix=1\n        ## file\n        - id: heshuang-file\n          uri: lb://heshuang-file\n          predicates:\n            - Path=/file/**\n          filters:\n            - SwaggerHeaderFilter\n            - StripPrefix=1\n# 打开客户端的监控\nmanagement:\n  endpoints:\n    sensitive: false\n    web:\n      exposure:\n        include: \'*\'\n\n', '28967eb643f4ce58e7ed46962f62d345', '2022-09-20 08:58:25', '2022-09-20 16:58:25', NULL, '172.24.0.1', 'D', '');
