INSERT INTO `his_config_info` VALUES (0, 1243, 'file.properties', 'dev', '', '# 1.5.0版本后，默认事务分组改成了default_tx_group\r\n# 参考：service.vgroupMapping.default_tx_group=default\r\nservice.vgroupMapping.my_test_tx_group=default\r\n# 存储模式\r\nstore.mode=db\r\n\r\nstore.db.datasource=druid\r\nstore.db.dbType=mysql\r\n# 需要根据mysql的版本调整driverClassName\r\n# mysql8及以上版本对应的driver：com.mysql.cj.jdbc.Driver\r\n# mysql8以下版本的driver：com.mysql.jdbc.Driver\r\nstore.db.driverClassName=com.mysql.cj.jdbc.Driver\r\n# 注意调整host和port\r\nstore.db.url=jdbc:mysql://192.168.43.1:33306/seata?useUnicode=true&characterEncoding=UTF-8&serverTimezone=Asia/Shanghai\r\n# 数据库用户名\r\nstore.db.user=root\r\n# 用户名密码\r\nstore.db.password=root', '5e14013ca52f458fb0d20bd7afcaa91f', '2022-09-21 02:55:21', '2022-09-21 10:55:21', NULL, '172.24.0.1', 'I', 'dev');
