INSERT INTO `his_config_info` VALUES (903, 1246, 'heshuang-auth-dev.yml', 'dev', '', 'spring:\n  zipkin:\n    base-url: http://127.0.0.1:9411\n  sleuth:\n    sampler:\n      probability: 1\n# 配置数据源\n  datasource:\n    driver-class-name: com.mysql.jdbc.Driver\n    url: jdbc:mysql://127.0.0.1:33306/heshuang-framework?useUnicode=true&characterEncoding=UTF-8&serverTimezone=Asia/Shanghai\n    username: root\n    password: root\n# mybatis-plus相关配置\nmybatis-plus:\n  # xml扫描，多个目录用逗号或者分号分隔（告诉 Mapper 所对应的 XML 文件位置）\n  mapper-locations: classpath:mapper/*.xml\n  configuration:\n    # 是否开启自动驼峰命名规则映射:从数据库列名到Java属性驼峰命名的类似映射\n    map-underscore-to-camel-case: true\n    # 如果查询结果中包含空值的列，则 MyBatis 在映射的时候，不会映射这个字段\n    call-setters-on-nulls: true\n    # 这个配置会将执行的sql打印出来，在开发或测试的时候可以用\n    log-impl: org.apache.ibatis.logging.stdout.StdOutImpl\n# Sa-Token配置\nsa-token: \n    # token名称 (同时也是cookie名称)\n    token-name: satoken\n    # token有效期，单位s 默认30天, -1代表永不过期 \n    timeout: 2592000\n    # token临时有效期 (指定时间内无操作就视为token过期) 单位: 秒\n    activity-timeout: -1\n    # 是否允许同一账号并发登录 (为true时允许一起登录, 为false时新登录挤掉旧登录) \n    is-concurrent: true\n    # 在多人登录同一账号时，是否共用一个token (为true时所有登录共用一个token, 为false时每次登录新建一个token) \n    is-share: false\n    # token风格\n    token-style: uuid\n    # 是否输出操作日志 \n    is-log: false\nseata:\n  enabled: true\n  application-id: ${spring.application.name}\n  txServiceGroup: default\n  # 是否开启数据源自动代理 如果不开启设置为false\n  enable-auto-data-source-proxy: true\n  registry:\n    type: nacos\n    nacos:\n      application: seata-server\n      server-addr: 127.0.0.1:8848\n      group: ${spring.profiles.active}\n      namespace: ${spring.profiles.active}\n  config:\n    type: nacos\n    nacos:\n      namespace:\n      serverAddr: localhost:8848\n      group: ${spring.profiles.active}\n      namespace: ${spring.profiles.active}     \n', 'a3a38d9cc6d3b19466e0c66806f62286', '2022-09-21 02:57:58', '2022-09-21 10:57:59', 'nacos', '172.24.0.1', 'U', 'dev');
